    featured: true,
  },
  {
    id: "03",
    title: "Trà hoa quả",
    price: 99,
    desc: "this is the description",
    photo: product3,
    featured: true,
  },
  {
    id: "04",
    title: "Hồng trà kem",
    price: 99,
    desc: "this is the description",
    photo: product4,
    featured: true,
  },
 ];

export default products;
